« - Tous les parents tiennent à leurs enfant plus qu’à leur propre vie. »
🐲
🐲
Une petite histoire très sympathique. Il y a pas mal de mystère même si le lecteur se fait des suppositions et il ne sait même pas s’il a vu juste ou pas.

On est replongé dans le passé de notre petit groupe, on revit les missions et les combats qu’il y a eu dans 𝐹𝑎𝑖𝒓𝒚 𝑇𝑎𝑖𝒍, et j’ai beaucoup apprécié.

